=<!DOCTYPE html>
<html lang="en" data-theme="dark">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Autonomous Agency Console</title>
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/@picocss/pico@1/css/pico.min.css">
    <script src="https://cdn.jsdelivr.net/npm/marked/marked.min.js"></script>
    <style>
        /* ================= THEME CONFIG ================= */
        :root {
            --primary: #f42564; /* Brand Pink */
            --background: #11191f;
            --surface: #1f2937;
            --spacing: 1rem;
            --code-bg: #2d3748;
        }

        body {
            display: flex;
            flex-direction: column;
            height: 100dvh;
            margin: 0;
            background-color: var(--background);
            font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif;
        }

        /* ================= HEADER ================= */
        header {
            padding: 0 var(--spacing);
            background-color: var(--surface);
            border-bottom: 1px solid #374151;
            display: flex;
            align-items: center;
            justify-content: space-between;
            height: 60px;
            flex-shrink: 0;
        }

        header h1 {
            margin: 0;
            font-size: 1.1rem;
            font-weight: 700;
            color: #fff;
            letter-spacing: 0.5px;
        }

        /* ================= CHAT AREA ================= */
        #chat-container {
            flex-grow: 1;
            overflow-y: auto;
            padding: var(--spacing);
            display: flex;
            flex-direction: column;
            gap: 1.5rem; /* More space between messages */
            scroll-behavior: smooth;
        }

        .message {
            max-width: 85%;
            padding: 0.5rem 1.2rem;
            border-radius: 1rem;
            font-size: 0.95rem;
            line-height: 1.6;
            position: relative;
            word-wrap: break-word;
            animation: fadeIn 0.3s ease;
        }

        @keyframes fadeIn {
            from { opacity: 0; transform: translateY(10px); }
            to { opacity: 1; transform: translateY(0); }
        }

        /* Bot Message (Left) */
        .message.bot {
            align-self: flex-start;
            background-color: var(--surface);
            color: #e5e7eb;
            border-bottom-left-radius: 2px;
        }

        /* User Message (Right) */
        .message.user {
            align-self: flex-end;
            background-color: var(--primary);
            color: #fff;
            border-bottom-right-radius: 2px;
        }

        /* ================= MARKDOWN STYLES ================= */
        /* These styles make the n8n lists look good */
        .message p { margin-bottom: 0.5rem; }
        .message p:last-child { margin-bottom: 0; }

        .message ul { 
            margin: 0.5rem 0; 
            padding-left: 1.5rem; 
        }

        .message li { margin-bottom: 0.25rem; }

        /* The IDs in code blocks */
        .message code {
            background-color: rgba(0,0,0,0.3);
            padding: 0.2rem 0.4rem;
            border-radius: 4px;
            font-family: monospace;
            font-size: 0.9em;
            color: #fbbf24; /* Amber color for IDs */
        }

        .message strong {
            color: #fff;
            font-weight: 700;
        }

        /* ================= FOOTER ================= */
        .typing {
            font-style: italic;
            font-size: 0.75rem;
            color: #6b7280;
            margin-left: 1.5rem;
            margin-bottom: 0.5rem;
            display: none;
        }

        footer {
            padding: var(--spacing);
            background-color: var(--surface);
            border-top: 1px solid #374151;
        }

        form {
            display: flex;
            gap: 0.75rem;
            margin: 0;
        }

        input[type="text"] {
            margin-bottom: 0;
            background-color: var(--background);
            border: 1px solid #4b5563;
            color: white;
            border-radius: 8px;
            padding-left: 1rem;
            flex-grow: 1;
        }

        input[type="text"]:focus {
            border-color: var(--primary);
            box-shadow: 0 0 0 1px var(--primary);
        }

        button {
            width: auto;
            margin-bottom: 0;
            border-radius: 8px;
            background-color: var(--primary);
            border: none;
            padding: 0 1.5rem;
            font-weight: 600;
            cursor: pointer;
            transition: background 0.2s;
        }

        button:hover { background-color: #db2777; }

        /* Scrollbar */
        #chat-container::-webkit-scrollbar { width: 6px; }
        #chat-container::-webkit-scrollbar-track { background: var(--background); }
        #chat-container::-webkit-scrollbar-thumb { background: #4b5563; border-radius: 3px; }
    </style>
</head>
<body>

    <header>
        <h1>Autonomous Agency Orchestrator</h1>
        <div style="width: 10px; height: 10px; background: #10b981; border-radius: 50%; box-shadow: 0 0 10px #10b981;"></div>
    </header>

    <div id="chat-container">
        <div class="message bot">
            <p><strong>System Online.</strong></p>
            <p>I am ready to orchestrate. Try asking:</p>
            <ul>
                <li>"Build a website for [Client]"</li>
                <li>"List my workflows"</li>
                <li>"Document workflow [ID]"</li>
            </ul>
        </div>
    </div>

    <div id="typing-indicator" class="typing">Agent is thinking...</div>

    <footer>
        <form id="chat-form">
            <input type="text" id="user-input" placeholder="Enter command..." autocomplete="off" required>
            <button type="submit">Execute</button>
        </form>
    </footer>

    <script>
        // ================= CONFIGURATION =================
        // Replace with your n8n Orch Webhook URL
        const WEBHOOK_URL = "{{ $env.PROD_WEBHOOK_URL }}"; 
        // =================================================

        const chatContainer = document.getElementById('chat-container');
        const chatForm = document.getElementById('chat-form');
        const userInput = document.getElementById('user-input');
        const typingIndicator = document.getElementById('typing-indicator');

        function scrollToBottom() {
            chatContainer.scrollTop = chatContainer.scrollHeight;
        }

        // ADD MESSAGE FUNCTION (Now supports Markdown)
        function addMessage(text, sender) {
            const messageDiv = document.createElement('div');
            messageDiv.classList.add('message', sender);

            if (sender === 'bot') {
                // Parse Markdown for the bot
                // marked.parse comes from the script included in <head>
                messageDiv.innerHTML = marked.parse(text);
            } else {
                // Keep user input as plain text to prevent HTML injection
                messageDiv.innerText = text;
            }

            chatContainer.appendChild(messageDiv);
            scrollToBottom();
        }

        chatForm.addEventListener('submit', async (e) => {
            e.preventDefault();
            const message = userInput.value.trim();
            if (!message) return;

            // 1. UI Updates
            addMessage(message, 'user');
            userInput.value = '';
            userInput.focus();
            typingIndicator.style.display = 'block';
            scrollToBottom();

            try {
                // 2. Send to n8n
                const response = await fetch(WEBHOOK_URL, {
                    method: 'POST',
                    headers: { 'Content-Type': 'application/json' },
                    body: JSON.stringify({ chatInput: message })
                });

                const data = await response.json();

                // 3. Handle Response
                typingIndicator.style.display = 'none';

                // We prioritize 'response' because that is what our Code Node outputs
                // Fallback to 'output', 'text', or raw JSON if needed
                const botReply = data.response || data.output || data.text || JSON.stringify(data);

                addMessage(botReply, 'bot');

            } catch (error) {
                console.error('Error:', error);
                typingIndicator.style.display = 'none';
                addMessage("**Error:** Could not connect to the Orchestrator.", 'bot');
            }
        });
    </script>
</body>
</html>
